CREATE PROCEDURE [dbo].[SpInsertaaSanidad] @fecha date,@empresa int,@fechaRegistro datetime,@fechaAnulado datetime,@anulado bit,@tipo varchar(50),@numero varchar(50),@finca varchar(50),@remision varchar(50),@nota varchar(950),@referencia varchar(50),@usuario varchar(50),@usuarioAnulado varchar(50),@seccion char(3),@Retorno int output  AS begin tran aSanidad insert aSanidad( fecha,empresa,fechaRegistro,fechaAnulado,anulado,tipo,numero,finca,remision,nota,referencia,usuario,usuarioAnulado,seccion ) select @fecha,@empresa,@fechaRegistro,@fechaAnulado,@anulado,@tipo,@numero,@finca,@remision,@nota,@referencia,@usuario,@usuarioAnulado,@seccion if (@@error = 0 ) begin set @Retorno = 0 commit tran aSanidad end else begin set @Retorno = 1 rollback tran aSanidad end